//超时了
func minMoves(nums []int, limit int) int {
	n := len(nums)
	m := make(map[int]int)
	for i := 0; i < n/2; i++ {
		m[nums[i]+nums[n-1-i]]++
	}
	if len(m) == 1 {
		return 0
	}
	var ans int = math.MaxInt32
	for target, _ := range m {
		temp := 0
		for i := 0; i < n/2; i++ {
			if nums[i]+nums[n-1-i] == target {
				continue
			}
			left, right := nums[i], nums[n-1-i]
			if left >= target && right >= target { //俩个都大于target
				temp += 2
				//nums[i], nums[n-1-i] = 1, target-1
			} else if left >= target || right >= target { //其中一个大于target
				temp++
			} else { //两个都小于target
				if left+limit >= target || right+limit >= target {
					temp++
				} else {
					temp += 2
				}
			}
		}
		if temp < ans {
			ans = temp
		}
	}

	return ans
}

func minMoves1(nums []int, limit int) int {
	//差分数组，diff[0...x]的和表示最终互补的数字和为x，需要的操作数
	//因为差分数组的计算需要更新r+1，所以数组的总大小在limit*2+1的基础上再+1
	diff := make([]int, limit*2+2)
	n := len(nums)

	for i := 0; i < n/2; i++ {
		A, B := nums[i], nums[n-i-1]
		//[2, 2*limit]范围+2
		l, r := 2, 2*limit
		diff[l] += 2
		diff[r+1] -= 2

		l = 1 + min(A, B)
		r = limit + max(A, B)
		diff[l] += -1
		diff[r+1] -= -1

		l, r = A+B, A+B
		diff[l] += -1
		diff[r+1] -= -1
	}

	res := n
	sum := 0
	for i := 2; i < 2*limit; i++ {
		sum += diff[i]
		if sum < res {
			res = sum
		}
	}
	return res
}

func min(a, b int) int {
	if a < b {
		return a
	}
	return b
}

func max(a, b int) int {
	if a > b {
		return a
	}
	return b
}
